import React, { Fragment } from 'react';
import './Nav2.css';



class Nav2 extends React.Component{
    constructor(props){
        super(props);
        

    }


    render(){
        return(
            <div className="main-nav">
				<nav>
                <ul>
                    <li>
                    <a href="#">Home</a>
                    </li>
                    <li>
                    <a href="#">About</a>
                    </li>
                    <li>
                    <a href="#">Services</a>
                    </li>
                    <li>
                    <a href="#">Contact</a>
                    </li>
                </ul>
                </nav>
			</div>
        );
    }
}   



export default Nav2;
